          type: string
          description: 'Effective date and time when the document status on the server is changed.<br> Format: yyyy-MM-ddTHH:mm:ss.SSS <br> <b>Note: </b>Consists of current server date.'
          example: 2021-01-31T23:59:59.999
      description: Details of the current status of the document
    DocumentStatusRecType:
      title: DocumentStatusRecType
      required:
      - DocumentKeys
      - DocumentStatus
      type: object
      properties:
        DocumentKeys:
          $ref: '#/components/schemas/DocumentKeysType'
        DocumentStatus:
          $ref: '#/components/schemas/DocumentStatusType'
    DocumentAddRsType:
      title: DocumentAddRsType
      required:
      - Status
      type: object
      properties:
        Status:
          $ref: '#/components/schemas/StatusType'
        DocumentStatusRec:
          $ref: '#/components/schemas/DocumentStatusRecType'
    DocumentDelRqType:
      title: DocumentDelRqType
      required:
      - DocumentKeys
      type: object
      properties:
        OvrdAutoAckInd:
          type: boolean
          description: Override AutoAcknowledge Indicator. Used when the midleware is in charge of  auto-acknowledgement of exceptions.
        OvrdExceptionData:
          $ref: '#/components/schemas/OvrdExceptionDataType'
        DocumentKeys:
          $ref: '#/components/schemas/DocumentKeysType'
    DocumentDelRsType:
      title: DocumentDelRsType
      required:
      - Status
      type: object
      properties:
        Status:
          $ref: '#/components/schemas/StatusType'
        DocumentStatusRec:
          $ref: '#/components/schemas/DocumentStatusRecType'
    RecCtrlInType:
      title: RecCtrlInType
      type: object
      properties:
        MaxRecLimit:
          type: integer
          description: 'Maximum number of records that can be returned within a single response. <br> <b>Note: </b>This field is used to set a limit on number of document records returned in response.'
          format: int64
      description: Maximum number of records that client can specify to process within a single response.
    DtRangeType:
      title: DtRangeType
      type: object
      properties:
        StartDt:
          pattern: '[0-9]{4}-[0-9]{2}-[0-9]{2}(T[0-9]{2}:[0-9]{2}(:[0-9]{2}(\.[0-9]{3})?((-|\+)[0-9]{2}:[0-9]{2})?)?)?'
          type: string
          description: 'Starting date and time.<br> Format: yyyy-MM-ddTHH:mm:ss.SSS'
          example: 2021-01-31T23:59:59.999
        EndDt:
          pattern: '[0-9]{4}-[0-9]{2}-[0-9]{2}(T[0-9]{2}:[0-9]{2}(:[0-9]{2}(\.[0-9]{3})?((-|\+)[0-9]{2}:[0-9]{2})?)?)?'
          type: string
          description: 'Ending date and time.<br> Format: yyyy-MM-ddTHH:mm:ss.SSS'
          example: 2021-01-31T23:59:59.999
      description: Time frame to search the documents using start-date and end-date criteria
    KeywordSelType:
      title: KeywordSelType
      required:
      - Keyword
      - KeywordValue
      - Operand
      type: object
      properties:
        Keyword:
          maxLength: 255
          type: string
          description: Keyword name to search the document, for example, Account Number, Check Number, etc.
        KeywordValue:
          maxLength: 255
          type: string
          description: Value of keyword. For example, if a keyword is set to Account Number then a keyword value would be an account number that you want to search.
        Operand:
          type: string
          description: |-
            Type of logical comparison between the detail and value of the keywords to search the document.<br> Valid values are:
              - EQ (Equals)
              - NOTEQ (Not equal to)
              - GT (Greater than)
              - GTEQ (Greater than or equal to)
              - LT (Less than)
              - LTEQ (Less than or equal to)
        AndorOr:
          $ref: '#/components/schemas/AndorOrType'
      description: Details to specify the keyword or logical combination of keywords for the document query
    KeywordsRequestedType:
      title: KeywordsRequestedType
      type: object
      properties:
        Keyword:
          maxLength: 255
          type: string
          description: 'Keyword name to search the document, for example, Account Number, Check Number, etc. <br> <b>Note: </b>This field is case sensitive.'
      description: Details that specify the requested keywords used to retrieve the documents
    PageNumRangeType:
      title: PageNumRangeType
      required:
      - StartPageNum
      type: object
      properties:
        StartPageNum:
          type: integer
          description: Starting number of the page range
          format: int64
        EndPageNum:
          type: integer
          description: Ending number of the page range
          format: int64
      description: Page number range to fetch the content of the documents
    MetaDataType:
      title: MetaDataType
      required:
      - Value
      type: object
      properties:
        Value:
          maxLength: 256
          type: string
          description: |-
            Value of the meta data that is returned based on the specified criteria.<br>
            Valid values are:
              - Fields
              - PageTotal
            <br> <b>Note: </b> If you require the searchable keyword types for a document, set the value to "Fields." If you require the totalnumber of pages for the document and the document size in bytes, set the value to "PageTotal".
        IncValueInd:
          type: boolean
          description: 'Flag to indicate whether to include the specified value of the type of metadata. <br> <b>Note: </b>If true, the response will include the types of metadata specified in the value field i.e. Fields and/or PageTotal.'
    DocumentSelType:
      title: DocumentSelType
      type: object
      properties:
        DocumentKeys:
          $ref: '#/components/schemas/DocumentKeysType'
        DocSelCriteria:
          type: array
          description: Criteria to select a document
          items:
            $ref: '#/components/schemas/DocSelCriteriaType'
        DtRange:
          $ref: '#/components/schemas/DtRangeType'
        UseXferKeywordInd:
          type: boolean
          description: Flag to indicate whether to use the middleware translation for keywords provided in the document selection criteria
        KeywordSel:
          type: array
          description: Details to specify the keyword constraints for the document query
          items:
            $ref: '#/components/schemas/KeywordSelType'
        DocProperties:
          type: array
          description: 'Details that specifies the properties of a document that need to be retuned in the response. <br> <b>Note: </b> When document properties are not provided in the EFX selection request, all document properties are retrieved in the response. If this aggregate is used, only the properties selected are provided.'
          items:
            $ref: '#/components/schemas/DocPropertiesType'
        KeywordMultireplace:
          maxLength: 80
          type: string
          description: 'Returns all keywords and related values of a document. <br> <b>Note: </b> Accepts only asterisk (*) character.'
        KeywordsRequested:
          type: array
          description: Details that specify the requested keywords used to retrieve the documents
          items:
            $ref: '#/components/schemas/KeywordsRequestedType'
        PageFormat:
          type: string
          description: "Page format of the requested document.<br>\nValid values are:\n  - TXT\n  - PDF\n  - TIFF\n  - JPG\n  - BMP\n  - PNG\n\n "
        PageNumRange:
          $ref: '#/components/schemas/PageNumRangeType'
        PageNum:
          type: integer
          description: 'Page number to be fetched within the document. <br> <b>Note: </b> All Pages can be requested by passing asterisk (*).'
          format: int64
        IncAllPagesInd:
          type: boolean
          description: Flag to indicate whether to include multiple pages in a single document link in the response
        MetaData:
          type: array
          description: Details of the additional information stored for each document and is required to identify the documents
          items:
            $ref: '#/components/schemas/MetaDataType'
      description: Document selection details
    DocumentInqRqType:
      title: DocumentInqRqType
      required:
      - DocumentSel
      type: object
      properties:
        RecCtrlIn:
          $ref: '#/components/schemas/RecCtrlInType'
