          format: int64
        Cursor:
          maxLength: 250
          type: string
          description: 'Next record pointer included in the response only if more than 250 posted transactions records exist. <br> <b>Note: </b>Premier returns a maximum of 250 posted transactions. If there are additional posted transactions, ESF will return Cursor value in this (RecCtrlOut/Cursor) field. This cursor value should be passed in the subsequent request within the RecCtrlIn/Cursor field to retrieve the next set of posted transactions. This feature is not applicable for memo post transactions.'
      description: Details of the information required to retrieve the records that matches the specified search criteria requested through RecCtrlIn aggregate
    DocumentRecType:
